import React from 'react';
import orderHistoryIcon from '../../../common/icons/components/orderHistoryIcon';
import currentOrderIcon from '../../../common/icons/components/currentOrderIcon';
import personalAccountIcon from '../../../common/icons/components/personalAccountIcon';

const buttonAuthorizedPageArray = [{
  className: 'historyOrdersColumn',
  text: 'История заказов',
  type: 'column',
},
{
  className: 'basketColumn',
  text: 'Текущие товары',
  type: 'column',
},
{
  className: 'personalDataColumn',
  text: 'Личные данные',
  type: 'column',
},
{
  className: 'exitButton',
  text: 'Выйти',
  type: 'column',
},
{
  className: 'historyOrdersRow',
  classNameString: 'historyOrdersString',
  text: 'История заказов',
  type: 'row',
  svg: <orderHistoryIcon />,
},
{
  className: 'basketRow',
  classNameString: 'basketString',
  text: 'Текущие товары',
  type: 'row',
  svg: <currentOrderIcon />,
},
{
  className: 'personalDataRow',
  classNameString: 'personalAccountString',
  text: 'Личные данные',
  type: 'row',
  svg: <personalAccountIcon />,
},
];

export default buttonAuthorizedPageArray;
